from queue import Queue
import time
import collections

class Node():
    def __init__(self, name, email = None, children=None):
        self.name = name
        self.email = email
        self.children = children


def recurse(root, visited):
    if root in visited:
        return []
    visited.append(root)
    if root.children is not None:
        grandchildren = []
        for child in root.children:
            grandchildren.extend(recurse(child, visited))
        grandchildren.append(root)
        return grandchildren
    else:
        return [root]

def accountsMerge(accounts):
    all_nodes = []
    email_nodes_map = {}
    start = time.time()
    for account in accounts:
        name = account[0]
        nodes = []
        for email in account[1:]:
            if email in email_nodes_map:
                node = email_nodes_map[email]
            else:
                node = Node(name, email)
                email_nodes_map[email] = node
            if node not in nodes:
                nodes.append(node)
        # for node in nodes:
        #     if node.children is None:
        #         node.children = nodes
        #     else:
        #         for child_node in nodes:
        #             node.children.append(child_node)
        for node1 in nodes:
            for node2 in nodes:
                if node1 != node2:

                    if node1.children is not None:
                        if node2 not in node1.children:
                            node1.children.append(node2)
                    else:
                        node1.children = [node2]

                    if node2.children is not None:
                        if node1 not in node2.children:
                            node2.children.append(node1)
                    else:
                        node2.children = [node1]
        if len(nodes) != 0:
            all_nodes.extend(nodes)
        else:
            all_nodes.append(Node(name))

    end = time.time()
    print('Time taken is ' + str((end - start) * 1000) + 'ms')

    mega_map = {}
    visited, output = [], []
    for node in all_nodes:
        if node not in visited:
            name = node.name

            q = Queue()
            q.put(node)
            subgraph = []
            while not q.empty():
                new_node = q.get()
                if new_node not in visited:
                    if new_node.children is not None:
                        for child in new_node.children:
                            if child not in mega_map:
                                q.put(child)
                                mega_map[child] = True
                    visited.append(new_node)
                    subgraph.append(new_node)

            #subgraph = recurse(node, visited)

            outlist, emails = [], []
            outlist.append(name)
            for node in subgraph:
                if node.email is not None:
                    emails.append(node.email)
            if len(emails) > 1:
                sorted_emails = sorted(emails)
                outlist.extend(sorted_emails)
            else:
                outlist.extend(emails)
            output.append(outlist)
            #visited.extend(subgraph)

    end = time.time()
    print('Time taken is ' + str((end - start) * 1000) + 'ms')

    return output


